import { Link } from "react-router-dom";


const ButtonLinkComponent = ({ linkURL, isButton, textColor, label }) => {
  return (
    <Link to={linkURL} className={`${isButton ? 'bg-blue-600' : 'bg-transparent'} ${textColor ? 'text-white' : ''}`}>{label}</Link>
  );
};

export default ButtonLinkComponent;
